Description: Where The Competition Is Stiff! Starring Alexis Ford!

It's time for more entertainment with the girls from the Cheerleaders Academy. This time, the girls have finished first in the West Coast Cheerleading Competition and they've won a vacation at a beautiful resort. The girls are all ready to have one heck of a good time when the coach passes out rules they have to follow-bed check at 10 pm, no boys in their room and daily workouts and exercise. Determined to have fun, head cheerleader Alexis figures out a way for them all to have naughty fun and still obey the rules. With a bunch of cute trainers and resort employees, the gals find a way to get wild and down and dirty and still obey the rules!

